import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import React, { createContext, useState } from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Home from './components/Home/Home/Home';
import AddImage from './components/AddImage/AddImage';
import DeleteImage from './components/DeleteImage/DeleteImage';
import SignIn from './components/SignIn/SignIn';
import SignUp from './components/SignUp/SignUp';
import UploadImage from './components/UploadImage/UploadImage';
import GetCommunityImages from './components/GetCommunityImages/GetCommunityImages';
import Login from './components/Login/Login';
import Dashboard from './components/Dashboard/Dashboard';
import PrivateRoute from './components/PrivateRoute/PrivateRoute';

export const UserContext = createContext();
function App() {
  const [loggedInUser, setLoggedInUser] = useState({});
  return (
    <UserContext.Provider value={[loggedInUser, setLoggedInUser]}>
      <Router>
        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <PrivateRoute  path="/addImage">
            <AddImage />
          </PrivateRoute>
          <PrivateRoute exact path="/dashBoard">
            <Dashboard />
          </PrivateRoute>
          <Route exact path="/upload">
            <UploadImage />
          </Route>
          <Route exact path="/upload">
            <UploadImage />
          </Route>
          <Route exact path="/deleteImage">
            <DeleteImage />
          </Route>
          <Route exact path="/signIn">
            <SignIn />
          </Route>
          <Route exact path="/signUp">
            <SignUp />
          </Route>
          <Route exact path="/signedIn">
            <Login />
          </Route>
        </Switch>
      </Router>
    </UserContext.Provider>
  );
}

export default App;
